// src/pages/UpdatesPage.jsx
import React from 'react';

function UpdatesPage() {
  return (
    <div>
      <h2>Güncellemeler</h2>
      <p>Firewall ve sistem güncellemeleri burada listelenecektir.</p>
    </div>
  );
}

export default UpdatesPage;
